Creation_tips1:
Функция «HD восстановление» не может быть включена в данный момент. Пожалуйста, проверьте, сделали ли вы следующие настройки:
1. Загрузили изображение в модуль «Изображение в изображение»;
2. Выбрали режим, отличный от «По умолчанию»;
3. Добавили «Сеть управления»;
Пожалуйста, отмените вышеуказанные настройки и попробуйте снова.

